UpdateContext({show_message_status: false});
If(
    !IsBlankOrError(global_colaborador_email),
    UpdateContext(
        {
            local_cargo: LookUp(
                'Cadastro de Colaboradores',
                EmailColaborador = global_colaborador_email
            ).Cargo,
            local_diretoria: LookUp(
                'Cadastro de Colaboradores',
                EmailColaborador = global_colaborador_email
            ).Diretoria,
            local_secao: LookUp(
                'Cadastro de Colaboradores',
                EmailColaborador = global_colaborador_email
            ).DescricaoSecao.Value
        }
    )
);
If(
    global_is_acesso_relatorio = true And global_id_feedback_acesso_relatorio > 0,
    ClearCollect(
        colecao_feedbacks,
        Filter(
            'Avaliação de Desempenho - Listagem Geral',
            ID = global_id_feedback_acesso_relatorio
        )
    );
    UpdateContext(
        {
            id_feedback_existente: LookUp(
                colecao_feedbacks,
                ID = global_id_feedback_acesso_relatorio
            ).ID
        }
    ),
    Refresh('Avaliação de Desempenho - Listagem Geral');
    ClearCollect(
        colecao_feedbacks,
        Filter(
            'Avaliação de Desempenho - Listagem Geral',
            EmailColaborador = global_colaborador_email And Ano = global_ciclo_ano
        )
    )
);
If(
    global_ciclo = const_ciclo_1,
    UpdateContext(
        {
            id_feedback_existente: LookUp(
                colecao_feedbacks,
                IsMatch(
                    CicloNovo,
                    "1",
                    Contains
                )
            ).ID
        }
    )
);
If(
    global_ciclo = const_ciclo_2,
    UpdateContext(
        {
            id_feedback_existente: LookUp(
                colecao_feedbacks,
                IsMatch(
                    CicloNovo,
                    "2",
                    Contains
                )
            ).ID,
            id_feedback_anterior: LookUp(
                colecao_feedbacks,
                IsMatch(
                    CicloNovo,
                    "1",
                    Contains
                )
            ).ID
        }
    )
);
If(
    global_ciclo = const_ciclo_3,
    UpdateContext(
        {
            id_feedback_existente: LookUp(
                colecao_feedbacks,
                IsMatch(
                    CicloNovo,
                    "3",
                    Contains
                )
            ).ID,
            id_feedback_anterior: LookUp(
                colecao_feedbacks,
                IsMatch(
                    CicloNovo,
                    "2",
                    Contains
                )
            ).ID
        }
    )
);
If(
    global_ciclo = const_ciclo_4,
    UpdateContext(
        {
            id_feedback_existente: LookUp(
                colecao_feedbacks,
                IsMatch(
                    CicloNovo,
                    "4",
                    Contains
                )
            ).ID,
            id_feedback_anterior: LookUp(
                colecao_feedbacks,
                IsMatch(
                    CicloNovo,
                    "3",
                    Contains
                )
            ).ID
        }
    )
);
If(
    !IsBlankOrError(id_feedback_existente),
    UpdateContext(
        {
            feedback_existente: First(
                Filter(
                    colecao_feedbacks,
                    ID = id_feedback_existente
                )
            )
        }
    );
    Set(
        global_valor_concluindo,
        feedback_existente.ConcluindoNovo
    )
);
If(
    !IsBlankOrError(id_feedback_anterior),
    UpdateContext(
        {
            feedback_anterior: First(
                Filter(
                    colecao_feedbacks,
                    ID = id_feedback_anterior
                )
            )
        }
    )
)

Reset(text_fazendo_continuar_fazer);
Reset(text_fazendo_deveria_mudar);
Reset(text_plano_de_acao);
Reset(data_plano_acao);
Reset(rating_concluindo);
Set(
    global_valor_concluindo,
    Blank()
);
If(
    global_is_acesso_relatorio = true,
    Navigate(
        relatorio,
        UnCover
    ),
    Navigate(
        Screen_Home,
        UnCover
    )
)

UpdateContext(
    {
        local_assinatura_gestor: User().FullName & " - " & Now(),
        fez_assinatura_gestor: true
    }
)

UpdateContext(
    {
        local_assinatura_colaborador: User().FullName & " - " & Now(),
        fez_assinatura_colaborador: true
    }
)

UpdateContext({show_message_status: false});
Clear(colecao_erros_feedback);
If(
    IsBlankOrError(text_fazendo_continuar_fazer.Text),
    Collect(
        colecao_erros_feedback,
        LookUp(
            colecao_mensagens_feedback,
            idioma = global_idioma
        ).campo_obrigatorio & label_fazendo_continuar_fazer.Text
    ),
    IsBlankOrError(text_fazendo_deveria_mudar.Text),
    Collect(
        colecao_erros_feedback,
        LookUp(
            colecao_mensagens_feedback,
            idioma = global_idioma
        ).campo_obrigatorio & label_fazendo_deveria_mudar.Text
    ),
    IsBlankOrError(text_plano_de_acao.Text),
    Collect(
        colecao_erros_feedback,
        LookUp(
            colecao_mensagens_feedback,
            idioma = global_idioma
        ).campo_obrigatorio & label_plano_acao.Text
    ),
    (IsBlankOrError(data_plano_acao.SelectedDate) Or data_plano_acao.SelectedDate <= Today()),
    Collect(
        colecao_erros_feedback,
        LookUp(
            colecao_mensagens_feedback,
            idioma = global_idioma
        ).campo_obrigatorio & label_data_plano_acao.Text
    ),
    (IsBlankOrError(rating_concluindo.Value) Or rating_concluindo.Value = 0),
    Collect(
        colecao_erros_feedback,
        LookUp(
            colecao_mensagens_feedback,
            idioma = global_idioma
        ).campo_obrigatorio & label_concluindo.Text
    )
);
If(
    CountRows(colecao_erros_feedback) = 0,
    If(
        fez_assinatura_gestor And !IsBlankOrError(id_feedback_existente),
            //Fez assinatura como gestor e é um feedback já existente
        UpdateIf(
            'Avaliação de Desempenho - Listagem Geral',
            ID = id_feedback_existente,
            {
                AceiteGestor: check_assinatura_gestor.Value,
                AssinaturaGestor: label_assinatura_gestor.Text,
                StatusNovo: If(
                    IsBlankOrError(feedback_existente.AssinaturaColaborador),
                    LookUp(
                        colecao_status,
                        idioma = feedback_existente.IdiomaNovo
                    ).status_feedback_aguardando_assinatura_colaborador,
                    LookUp(
                        colecao_status,
                        idioma = feedback_existente.IdiomaNovo
                    ).status_feedback_finalizado
                ),
                'O que o colaborador está fazendo que deve continuar a fazer? Justifique com exemplos': text_fazendo_continuar_fazer.Text,
                'O que o colaborador está fazendo que deveria mudar/melhorar? Justifique com exemplos.': text_fazendo_deveria_mudar.Text,
                'Plano de Ação: O que o colaborador precisa fazer para mudar/melhorar?': text_plano_de_acao.Text,
                Prazo: data_plano_acao.SelectedDate,
                //EmailColaborador: global_colaborador_email;
                //EmailGestor: global_email_gestor;
                Ano: global_ciclo_ano,
                Idioma: {Value: global_idioma},
                ConcluindoNovo: label_descricao_concluindo.Text,
                Concluído: {Value: label_descricao_concluindo.Text},
                CicloNovo: global_ciclo,
                Ciclo: {Value: global_ciclo}

            }
        )
    );
    If(
        fez_assinatura_colaborador And !IsBlankOrError(id_feedback_existente),
            //Fez assinatura como colaborador e é um feedback já existente
        UpdateIf(
            'Avaliação de Desempenho - Listagem Geral',
            ID = id_feedback_existente,
            {
                AceiteColaborador: check_assinatura_colaborador.Value,
                AssinaturaColaborador: label_assinatura_colaborador.Text,
                StatusNovo: If(
                    IsBlankOrError(feedback_existente.AssinaturaGestor),
                    LookUp(
                        colecao_status,
                        idioma = feedback_existente.IdiomaNovo
                    ).status_feedback_aguardando_assinatura_gestor,
                    LookUp(
                        colecao_status,
                        idioma = feedback_existente.IdiomaNovo
                    ).status_feedback_finalizado
                ),
                'O que o colaborador está fazendo que deve continuar a fazer? Justifique com exemplos': text_fazendo_continuar_fazer.Text,
                'O que o colaborador está fazendo que deveria mudar/melhorar? Justifique com exemplos.': text_fazendo_deveria_mudar.Text,
                'Plano de Ação: O que o colaborador precisa fazer para mudar/melhorar?': text_plano_de_acao.Text,
                Prazo: data_plano_acao.SelectedDate,
                //EmailColaborador: global_colaborador_email;
                //EmailGestor: global_email_gestor;
                Ano: global_ciclo_ano,
                Idioma: {Value: global_idioma},
                ConcluindoNovo: label_descricao_concluindo.Text,
                Concluído: {Value: label_descricao_concluindo.Text},
                CicloNovo: global_ciclo,
                Ciclo: {Value: global_ciclo}
            }
        )
    );
    If(
        (!fez_assinatura_colaborador And !fez_assinatura_gestor) And !IsBlankOrError(id_feedback_existente),
            //Não fez nenhuma assinatura e é um feedback já existente
        UpdateIf(
            'Avaliação de Desempenho - Listagem Geral',
            ID = id_feedback_existente,
            {
                'O que o colaborador está fazendo que deve continuar a fazer? Justifique com exemplos': text_fazendo_continuar_fazer.Text,
                'O que o colaborador está fazendo que deveria mudar/melhorar? Justifique com exemplos.': text_fazendo_deveria_mudar.Text,
                'Plano de Ação: O que o colaborador precisa fazer para mudar/melhorar?': text_plano_de_acao.Text,
                Prazo: data_plano_acao.SelectedDate,
                //EmailColaborador: global_colaborador_email;
                //EmailGestor: global_email_gestor;
                Ano: global_ciclo_ano,
                Idioma: {Value: global_idioma},
                ConcluindoNovo: label_descricao_concluindo.Text,
                Concluído: {Value: label_descricao_concluindo.Text},
                CicloNovo: global_ciclo,
                Ciclo: {Value: global_ciclo},
                RascunhoVisivel: If(
                    check_visivel_para_colaborador.Value,
                    "Sim",
                    "Não"
                )
            }
        )
    );
    If(
        IsBlankOrError(id_feedback_existente),
            //Novo Feedback
        Patch(
            'Avaliação de Desempenho - Listagem Geral',
            Defaults('Avaliação de Desempenho - Listagem Geral'),
            {
                Cargo: local_cargo,
                Diretoria: local_diretoria,
                Secao: local_secao,
                'O que o colaborador está fazendo que deve continuar a fazer? Justifique com exemplos': text_fazendo_continuar_fazer.Text,
                'O que o colaborador está fazendo que deveria mudar/melhorar? Justifique com exemplos.': text_fazendo_deveria_mudar.Text,
                'Plano de Ação: O que o colaborador precisa fazer para mudar/melhorar?': text_plano_de_acao.Text,
                Prazo: data_plano_acao.SelectedDate,
                EmailColaborador: global_colaborador_email,
                EmailGestor: global_email_gestor,
                Ano: global_ciclo_ano,
                Idioma: {Value: global_idioma},
                StatusNovo: If(
                    check_assinatura_gestor.Value = true,
                    LookUp(
                        colecao_status,
                        idioma = global_idioma
                    ).status_feedback_aguardando_assinatura_colaborador,
                    check_assinatura_colaborador.Value = true,
                    LookUp(
                        colecao_status,
                        idioma = global_idioma
                    ).status_feedback_aguardando_assinatura_gestor,
                    LookUp(
                        colecao_status,
                        idioma = global_idioma
                    ).status_feedback_rascunho
                ),
                ConcluindoNovo: label_descricao_concluindo.Text,
                Concluído: {Value: label_descricao_concluindo.Text},
                IdiomaNovo: global_idioma,
                CicloNovo: global_ciclo,
                Ciclo: {Value: global_ciclo},
                AceiteGestor: check_assinatura_gestor.Value,
                AssinaturaGestor: label_assinatura_gestor.Text,
                AceiteColaborador: check_assinatura_colaborador.Value,
                AssinaturaColaborador: label_assinatura_colaborador.Text,
                RascunhoVisivel: If(
                    check_visivel_para_colaborador.Value,
                    "Sim",
                    "Não"
                )
            }
        )
    );
    If(
        IsEmpty(Errors('Avaliação de Desempenho - Listagem Geral')),
        Refresh('Avaliação de Desempenho - Listagem Geral');
        ClearCollect(
            colecao_feedbacks,
            Filter(
                'Avaliação de Desempenho - Listagem Geral',
                EmailColaborador = global_colaborador_email And Ano = global_ciclo_ano
            )
        );
        If(
            global_ciclo = const_ciclo_1,
            UpdateContext(
                {
                    id_feedback_existente: LookUp(
                        colecao_feedbacks,
                        IsMatch(
                            CicloNovo,
                            "1",
                            Contains
                        )
                    ).ID
                }
            )
        );
        If(
            global_ciclo = const_ciclo_2,
            UpdateContext(
                {
                    id_feedback_existente: LookUp(
                        colecao_feedbacks,
                        IsMatch(
                            CicloNovo,
                            "2",
                            Contains
                        )
                    ).ID
                }
            )
        );
        If(
            global_ciclo = const_ciclo_3,
            UpdateContext(
                {
                    id_feedback_existente: LookUp(
                        colecao_feedbacks,
                        IsMatch(
                            CicloNovo,
                            "3",
                            Contains
                        )
                    ).ID
                }
            )
        );
        If(
            global_ciclo = const_ciclo_4,
            UpdateContext(
                {
                    id_feedback_existente: LookUp(
                        colecao_feedbacks,
                        IsMatch(
                            CicloNovo,
                            "4",
                            Contains
                        )
                    ).ID
                }
            )
        );
        If(
            !IsBlankOrError(id_feedback_existente),
            UpdateContext(
                {
                    feedback_existente: First(
                        Filter(
                            colecao_feedbacks,
                            ID = id_feedback_existente
                        )
                    )
                }
            )
        );
        Notify(
            "Success",
            NotificationType.Success
        );
        UpdateContext({show_message_status: true});
        Reset(check_assinatura_gestor);
        Reset(check_assinatura_colaborador);
        UpdateContext(
            {
                local_assinatura_gestor: Blank(),
                local_assinatura_colaborador: Blank()
            }
        );
        Navigate(
            Screen_Home,
            UnCoverRight
        ),
        UpdateContext({show_message_status: true});
        Notify(
            First(Errors('Avaliação de Desempenho - Listagem Geral')).Message,
            NotificationType.Error
        )
    ),
    UpdateContext({show_message_status: true});

)

UpdateContext({show_message_status: false});
Clear(colecao_erros_feedback);
Set(
    local_historico_observacoes,
    feedback_historico_devolver.Text
);
Set(
    local_comentarios,
    feedback_comentarios_devolver.Text
);
UpdateIf(
    'Avaliação de Desempenho - Listagem Geral',
    ID = id_feedback_existente,
    {
        StatusNovo: LookUp(
            colecao_status,
            idioma = global_idioma
        ).status_feedback_aguardando_ajustes,
        AceiteColaborador: false,
        AssinaturaColaborador: Blank(),
        AceiteGestor: false,
        AssinaturaGestor: Blank(),
        ObservacoesNovo: local_historico_observacoes & Char(10) & User().FullName & " - " & Today() & ": " & local_comentarios & Char(10)
    }
);
Reset(feedback_comentarios_devolver);
If(
    IsEmpty(Errors('Avaliação de Desempenho - Listagem Geral')),
    Refresh('Avaliação de Desempenho - Listagem Geral');
    ClearCollect(
        colecao_feedbacks,
        Filter(
            'Avaliação de Desempenho - Listagem Geral',
            EmailColaborador = global_colaborador_email And Ano = global_ciclo_ano
        )
    );
    If(
        global_ciclo = const_ciclo_1,
        UpdateContext(
            {
                id_feedback_existente: LookUp(
                    colecao_feedbacks,
                    IsMatch(
                        CicloNovo,
                        "1",
                        Contains
                    )
                ).ID
            }
        )
    );
    If(
        global_ciclo = const_ciclo_2,
        UpdateContext(
            {
                id_feedback_existente: LookUp(
                    colecao_feedbacks,
                    IsMatch(
                        CicloNovo,
                        "2",
                        Contains
                    )
                ).ID
            }
        )
    );
    If(
        global_ciclo = const_ciclo_3,
        UpdateContext(
            {
                id_feedback_existente: LookUp(
                    colecao_feedbacks,
                    IsMatch(
                        CicloNovo,
                        "3",
                        Contains
                    )
                ).ID
            }
        )
    );
    If(
        global_ciclo = const_ciclo_4,
        UpdateContext(
            {
                id_feedback_existente: LookUp(
                    colecao_feedbacks,
                    IsMatch(
                        CicloNovo,
                        "4",
                        Contains
                    )
                ).ID
            }
        )
    );
    If(
        !IsBlankOrError(id_feedback_existente),
        UpdateContext(
            {
                feedback_existente: First(
                    Filter(
                        colecao_feedbacks,
                        ID = id_feedback_existente
                    )
                )
            }
        )
    );
    Notify(
        "Success",
        NotificationType.Success
    ),
    Notify(
        First(Errors('Avaliação de Desempenho - Listagem Geral')).Message,
        NotificationType.Error
    )
);
UpdateContext(
    {
        local_assinatura_gestor: Blank(),
        fez_assinatura_gestor: false,
        local_assinatura_colaborador: Blank(),
        fez_assinatura_colaborador: false
    }
);
Reset(check_assinatura_gestor);
Reset(check_assinatura_colaborador);
UpdateContext({show_message_status: true});
Back()
